import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        alignItems: "center",
        flexDirection: "row",
        paddingBottom: 8,
        paddingLeft: 15,
        paddingRight: 15,
        paddingTop: 6
    },
    avatarContainer: {
        marginRight: 12
    },
    userTitle: {
        justifyContent: "flex-start",
        fontSize: 21,
        fontFamily: "RobotoRegular",
        color: "#F55C22",
        marginRight: 8
    },
    userDesc: {
        fontSize: 12,
        fontFamily: "RobotoRegular",
        marginVertical: 2,
        color: "#414141"
    },
    titleButton: {
        color: "#ffffff",
        fontFamily: "RobotoMedium",
        fontSize: 12
    },
    editButton: {
        padding: 1,
        borderColor: "#F55C22",
        backgroundColor: "#F55C22",
        borderWidth: 1
    },
    editButtonContainer: {
        width: 80,
        marginVertical: 10,
        backgroundColor: "#F55C22"
    },
    textContainer: {
        flex: 1,
        marginVertical: 5,
        flexDirection: "row",
        justifyContent: "flex-start",
        alignItems: "flex-start"
    },
    userInfomationIcon: {
        textAlign: "center",
        textAlignVertical: "center",
        alignSelf: "center",
        justifyContent: "center",
        alignItems: "center",
        alignContent: "center",
        borderRadius: 5,
        borderColor: "#F55C22",
        borderWidth: 2,
        padding: 2,
        marginRight: 6
    },
});

export default styles;
